      <div class="content-inputs">
        <vs-input
          v-model="value"
          label-placeholder="e.g octocat/hello-world"
          icon-after
          @click-icon="search"
        >
          <template #icon>
            <i class="bx bx-search"></i>
          </template>
          <template v-if="validSearch" #message-success>
            Search is Valid
          </template>
          <template v-if="!validSearch && value !== ''" #message-danger>
            Search Invalid
          </template>
        </vs-input>
      </div>
      <div class="table--content">
        <vs-table v-model="selected">
          <template #header>
            <vs-input v-model="mySearch" border placeholder="Search" />
          </template>
          <template #thead>
            <vs-tr>
              <vs-th> Full Name </vs-th>
              <vs-th> Owner </vs-th>
              <vs-th> Repo URL </vs-th>
              <vs-th> Stars </vs-th>
              <vs-th> Favorite </vs-th>
            </vs-tr>
          </template>
          <template v-if="!dataLoading" #tbody>
            <vs-tr
              v-for="(tr, i) in $vs.getSearch(results.data, mySearch)"
              :key="i"
              :data="tr"
              :is-selected="selected == tr"
            >
              <vs-td>
                {{ tr.full_name }}
              </vs-td>
              <vs-td>
                {{ tr.owner.login }}
              </vs-td>
              <vs-td>
                <a target="_blank" :href="tr.html_url">{{ tr.html_url }}</a>
              </vs-td>
              <vs-td>
                {{ tr.stargazers_count }}
                <i class="bx bxs-star"></i>
              </vs-td>
              <vs-td>
                <i v-if="setFavouriteCol(tr.id)" class="bx bxs-heart"></i>
                <i v-else class="bx bx-heart"></i>
              </vs-td>
            </vs-tr>
          </template>
          <template v-if="!dataLoading" #footer>
            <vs-pagination v-model="page" :length="Number(pages)" />
          </template>
        </vs-table>
        <vs-dialog v-model="selected" blur>
          <template #header>
            <h4 v-if="selected" class="not-margin">
              Add <span class="success">{{ selected.full_name }}</span> to
              <b>Favourites</b>
            </h4>
          </template>
          <template #footer>
            <div class="footer-dialog">
              <vs-button block @click="addFav"> Add </vs-button>
            </div>
          </template>
        </vs-dialog>
      </div>
    </div>
  </main>
</template>

<script>
import { Octokit } from '@octokit/core'
import * as parse from 'parse-link-header'

import { mapGetters } from 'vuex'
const octokit = new Octokit({
  auth: `26c357893f604bb91e8722b217a71f47184cf119`,
})
export default {
  async asyncData({ store, route }) {
    console.log('running fetch')
    await store.commit('setRepo', route.query.Repository)

    await store.dispatch('search', route.query.page)
    await store.commit('setLoading', false)
  },
  data() {
    return {
      value: '',
      selected: null,
      max: 20,
      page: 1,
      mySearch: '',
    }
  },
  watch: {
    async page(val) {
      await this.$store.dispatch('search', val)
    },
  },
  computed: {
    validSearch() {
      return /^\w+([\.-]?\w+)*\/\w+([\.-]?\w+)$/.test(this.value)
    },
    pages() {
      const pageSet = parse(this.results.headers.link)
      console.log(pageSet)
      if (pageSet.last) {
        return pageSet.last.page
      } else {
        return Number(pageSet.prev.page) + 1
      }
    },
    ...mapGetters({
      results: 'result',
      owner: 'owner',
      repo: 'repo',
      dataLoading: 'dataLoading',
      favIDs: 'favIDs',
    }),
  },

  methods: {
    async search() {
      const result = this.value.split('/')
      const owner = result[0]
      const repo = result[1]

      await this.$store.commit('setOwner', owner)
      await this.$store.commit('setRepo', repo)

      const page = 1
      await this.$store.dispatch('search', page)
      this.value = ''
    },
    addFav() {
      this.$fire.database.ref('favs').push(this.selected.id)
      this.$store.commit('setFavs', [...this.favIDs, this.selected.id])
      this.selected = false
      console.log('added new fav', this.selected.id)
    },
    setFavouriteCol(id) {
      const myFav = this.favIDs.find((fav) => {
        return fav === id
      })
      return myFav
    },
  },
}
</script>

